import React from "react";
import "./Card.css"

const Card= (props)=>{
    return(
        <div className="contenedor">
           <h2 className="titulo">{props.todo.titulo} </h2>
           <h2>{console.log( props.todo.responsable)}</h2>
           <h2>{props.todo.descripcion}</h2>
           <h2>{props.todo.prioridad}</h2>
        </div>
    )
}
export default Card;
